import React from "react";

const FormNewItem = (props) => {
return (
    <div className="mt-3">
        <form></form>
    <button 
    className='btn btn-primary'
    onClick={props.addContact}>
      New contact
    </button>
  </div>
);
}
export default FormNewItem;
